	function MyFungsi15(){
		/*
		// f(x+1) = x + f(x)
		// f(2) = 2
		*/
		function _fx(_f1,_x){
			var jum = _f1;
			//console.log(jum);
			for(var i=2;i<_x;i++){
				jum+=i;
				//console.log(jum+" "+i);
			}
			//console.log("----------");
			return jum;
		}
		
		var f1 = RandomAngkaAtoB(0,9);
		var x1 = RandomAngkaAtoB(1,9);
		var fx1 = _fx(f1,x1);
		do{
			var xx = RandomAngkaAtoB(1,9);
		}while(xx==x1);
		var fx = _fx(f1,xx);
		var ArSisi = [x1,fx1,xx];
		
		var benar = fx;					if(fx<0)	benar = "\u{2212}"+Math.abs(fx);
		var salah1 = fx-1;				if(fx-1<0)	salah1 = "\u{2212}"+Math.abs(fx-1);
		var salah2 = fx+1;				if(fx+1<0)	salah2 = "\u{2212}"+Math.abs(fx+1);
		var salah3 = fx-2;				if(fx-2<0)	salah3 = "\u{2212}"+Math.abs(fx-2);
		var salah4 = fx+2;				if(fx+2<0)	salah4 = "\u{2212}"+Math.abs(fx+2);
		var salah5 = fx-3;				if(fx-3<0)	salah5 = "\u{2212}"+Math.abs(fx-3);
		var salah6 = fx+3;				if(fx+3<0)	salah6 = "\u{2212}"+Math.abs(fx+3);
		arrSalah = [salah1,salah2,salah3,salah4,salah5,salah6];
		do{
			arrSalah = RandomMyArray(arrSalah);
			var ff1 = arrSalah[0]==benar || arrSalah[1]==benar || arrSalah[2]==benar;
		}while(ff1);
		return [ArSisi,benar,arrSalah];
	}
	
